import users from "../data/user_list.json"

const getUserData = () => {
  let i = 0;
  let searchUser = [];

  users['users'].forEach(user => {
    const container = require(`../data/users/${user}.json`);
    const changeName = container => !container ? "" : container

    searchUser.push([
      {
        key: i,
        type: "id",
        data: changeName(container.resources[0].data.CUCUser[0].Alias)
      },
      {
        key: i,
        type: "name",
        data: changeName(container.resources[0].data.CUCUser[0])
      }
    ])

    console.log(searchUser)
  })
}

export default getUserData();
